import fetch from 'isomorphic-fetch'
import {API} from '../config'
const Signup=(user)=>{
    console.log(user)
    return fetch(`${API}/signup`,{
        method:'POST',
        headers:{
            Accept:'application/json',
            'Content-type':'application/json'
        },
        body:user
    }).then((response)=>{
        console.log(response.json())
        return response
    }).catch((err)=>{
        console.log(err)
    })
    
}
export default Signup
